import Link from 'next/link'
import styles from './Nav.module.css'

const Nav = () => (
    <div>
        <Link href="/"><a><img href="../images/nav"/></a></Link>
        <Link href="/kamers"><a>kamers</a></Link>
    </div>
);

export default Nav;

